# Kamayevo, Urmanayevsky Selsoviet, Bakalinsky District, Republic of Bashkortostan

}}
Kamayevo (; , Qamay) is a rural locality (a selo) in Urmanayevsky Selsoviet, Bakalinsky District, Bashkortostan, Russia. The population was 136 as of 2010.
Geography
It is located 47&nbsp;km from Bakaly and 8&nbsp;km from Urmanayevo.
